open! Core
open Bonsai_web

type t =
  | Capybara
  | Abstract_camels
  | Camel_v_robot
  | Capybara_v_camel
  | Camel_v_camel
[@@deriving enumerate]

let capybara =
  "data:image/jpg;base64,"
;;

let abstract_camels =
  "data:image/jpg;base64,"
;;

let camel_v_robot =
  "data:image/jpg;base64,\n"
;;

let capybara_v_camel =
  "data:image/jpg;base64,"
;;

let camel_v_camel =
  "data:image/jpg;base64,"
;;

let src = function
  | Capybara -> capybara
  | Abstract_camels -> abstract_camels
  | Camel_v_robot -> camel_v_robot
  | Capybara_v_camel -> capybara_v_camel
  | Camel_v_camel -> camel_v_camel
;;

let description = function
  | Capybara -> {|"Capybaras shopping for groceries, ukiyo-e."|}
  | Abstract_camels ->
    {|"Renaissance Painting of a robot and a camel playing tic tac toe."|}
  | Camel_v_robot ->
    {|"An impressionist oil painting of a camel playing tic tac toe."|}
  | Capybara_v_camel -> {|"A capybara playing tic tac toe against a camel."|}
  | Camel_v_camel ->
    {|"A camel playing tic tac toe against a robot, ukiyo-e."|}
;;

let vdom image =
  Vdom.Node.img
    ~attrs:
      [ Vdom.Attr.src (src image)
      ; Style.homepage_painting
      ; Vdom.Attr.create
          "alt"
          "Dalle image of animals/robots playing tictactoe or going to \
           groceries"
      ]
    ()
;;

let uno_reverse_card_jpeg =
  "data:image/jpeg;base64,"
;;

let uno_reverse_card =
  Vdom.Node.img
    ~attrs:
      [ Vdom.Attr.src uno_reverse_card_jpeg
      ; Style.homepage_painting
      ; Vdom.Attr.create
          "alt"
          "Dalle image of animals/robots playing tictactoe or going to \
           groceries"
      ]
    ()
;;
